import styled from 'styled-components';

const ComponentIcon = styled.div`
  margin: 12px 0;
  margin-right: 20px;
  display: flex;
  width: 35px;
  height: 35px;
  align-items: center;
  text-align: center;
  border-radius: 50%;
  background-color: #aed4fb;

  svg {
    margin: auto;
    font-size: 16px;
    color: #007eff;
  }
`;

export default ComponentIcon;
